215 and Counting is out everywhere you listen to music. 

Wow.. It’s been an absolute honour to be a part of the journey of this song so far. I wrote and shared the first verse two years ago in an attempt to process feelings and thoughts that felt too big to fully understand. I never expected it to be able to provide so many others with that same grounding for reflection, healing and hope. 

This song has always been so much bigger than one person; so many people came together to make it possible. I will try to shine light on everyone who was a part of it throughout this week. 

@patrickmitsuing is the unbelievable dancer in this video ❤️‍🔥 his company @powwowtimes will be distributing and using all of the streaming royalties from this song to help their mission of cultural preservation and individual aid. 

@okpik.k33 is an Inuk throat singer who’s performance is featured from verse 2 all the way until the end of the song

