My talented and unfailingly kind friend, @ismailciydem put together this recap of our sold out opening show at the Cameron House 🫶🏻

Thank you to everyone who came out and to everyone who worked behind the scenes to make it possible! 

Some highlights:
@leahholtom debuted her song Lady Blue which just came out today!! 💙

@stuweinberg melted our faces with a solo during our cover of Brother by @mattcorby 

@softplacetolandofficial serenaded us with beautifully intentional tones and vulnerably truthful  lyrics that grounded us into the space 

A friend of mine showed me his new matching tattoo with the lyrics of Whole in it that he recently got with his partner ♥️♥️

I was lucky enough to share the stage with these beautiful people who worked their asses off learning the forms of my music so that we could be comfortable enough to improvise in, out and around  them durning the show. It wasn’t perfect but it was ALIVE! I would take that over perfection any day. 

